import './App.css';

function App() {
  const panels = document.querySelectorAll('.panel');

  panels.forEach(panel => {

    panel.addEventListener('click', () => {
      removeActiveClasses()
      panel.classList.add('active')
    })
  })
  function removeActiveClasses() {
    panels.forEach(panel => {
      panel.classList.remove('active')

    })
  }






  return (
    <div className="App">

      <div className="container">
        <div className="panel" style={{ backgroundImage: "url('https://i.pinimg.com/originals/f9/cd/01/f9cd01c23d2d10c848c7b6644b9364b3.jpg')" }}>
          <h3>Ryu Over Sagat</h3>
        </div>
        <div className="panel" style={{ backgroundImage: "url('https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/04c3e818-da6e-4c70-93b3-44676d57c0ea/d6gsgxk-8889c7bb-ba6b-4c51-9aaa-213d922b26df.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..QY0usY4rJ3tHpMLa1AdyV9WdQn8QlP51G7c6R_oRx0Q')" }}>
          <h3>Ryu vs Ken</h3>
        </div>
        <div className="panel" style={{ backgroundImage: "url('data:image/jpeg;base64,')" }}>
          <h3>Ryu vs Captain America</h3>
        </div>
        <div className="panel" style={{ backgroundImage: "url('https://external-preview.redd.it/EJuCoJzbkCZYzAt9Uy8l9dIiNQpi6Zg_smiJqltmOCg.jpg?auto=webp&s=d4d4cf8c3f4726b347de5d79162d827a2bf98fb3')" }}>
          <h3>Ryu vs Bison</h3>
        </div>
      </div>

    </div>
  );
}

export default App;
